insert  into `起点列表`(`md5`,`数据id`,`分类1`,`小说主页`,`分类2`,`作者首页`,`作者`,`发布状态`,`书面`,`小说简介`,`书名`) values (NULL,'1010734492','仙侠','https:////book.qidian.com/info/1010734492','神话修真','https:////my.qidian.com/author/4362771','忘语','连载中','https:////bookcover.yuewen.com/qdbimg/349573/1010734492/150','\r                        凡人修仙，风云再起时空穿梭，轮回逆转金仙太乙，大罗道祖三千大道，法则至尊《凡人修仙传》仙界篇，一个韩立叱咤仙界的故事，一个凡人小子修仙的不灭传说。特说明下，没有看过前传的书友，并不影响本书的阅读体验，\r                    ','凡人修仙之仙界篇');
insert  into `起点列表`(`md5`,`数据id`,`分类1`,`小说主页`,`分类2`,`作者首页`,`作者`,`发布状态`,`书面`,`小说简介`,`书名`) values (NULL,'1010868264','玄幻','https:////book.qidian.com/info/1010868264','异世大陆','https:////my.qidian.com/author/4362088, https:////www.qidian.com/2cy','爱潜水的乌贼, 二次元','连载中','https:////bookcover.yuewen.com/qdbimg/349573/1010868264/150','\r                        蒸汽与机械的浪潮中，谁能触及非凡？历史和黑暗的迷雾里，又是谁在耳语？我从诡秘中醒来，睁眼看见这个世界：枪械，大炮，巨舰，飞空艇，差分机；魔药，占卜，诅咒，倒吊人，封印物……光明依旧照耀，神秘从未远离，\r                    ','诡秘之主');
insert  into `起点列表`(`md5`,`数据id`,`分类1`,`小说主页`,`分类2`,`作者首页`,`作者`,`发布状态`,`书面`,`小说简介`,`书名`) values (NULL,'1004608738','玄幻','https:////book.qidian.com/info/1004608738','东方玄幻','https:////my.qidian.com/author/4362453','辰东','连载中','https:////bookcover.yuewen.com/qdbimg/349573/1004608738/150','\r                        在破败中崛起，在寂灭中复苏。沧海成尘，雷电枯竭，那一缕幽雾又一次临近大地，世间的枷锁被打开了，一个全新的世界就此揭开神秘的一角……\r                    ','圣墟');
