insert  into `起点列表`(`md5`,`数据id`,`分类1`,`小说主页`,`分类2`,`作者首页`,`作者`,`发布状态`,`书面`,`小说简介`,`书名`) values (NULL,'1011705052','历史','https:////book.qidian.com/info/1011705052','两宋元明','https:////my.qidian.com/author/2438700','上山打老虎额','连载中','https:////bookcover.yuewen.com/qdbimg/349573/1011705052/150','\r                        重要通知，明朝败家子，又名《明颂》。弘治十一年。这是一个美好的清晨。此时朱厚照初成年。此时王守仁和唐伯虎磨刀霍霍，预备科举。此时小冰河期已经来临，绵长的严寒肆虐着大地。此时在南和伯府里，地主家的傻儿子\r                    ','明朝败家子');
insert  into `起点列表`(`md5`,`数据id`,`分类1`,`小说主页`,`分类2`,`作者首页`,`作者`,`发布状态`,`书面`,`小说简介`,`书名`) values (NULL,'1009480992','游戏','https:////book.qidian.com/info/1009480992','游戏异界','https:////my.qidian.com/author/4185352','齐佩甲','连载中','https:////bookcover.yuewen.com/qdbimg/349573/1009480992/150','\r                        韩萧，《星海》骨灰级代练，被来自东（zuo）方(zhe)的神秘力量扔进穿越大军，携带玩家面板变成NPC，回到《星海》公测之前，毅然选择难度最高的机械系。战舰列队纵横星海，星辰机甲夭矫如龙，幽能炮毁天灭\r                    ','超神机械师');
insert  into `起点列表`(`md5`,`数据id`,`分类1`,`小说主页`,`分类2`,`作者首页`,`作者`,`发布状态`,`书面`,`小说简介`,`书名`) values (NULL,'1011449273','科幻','https:////book.qidian.com/info/1011449273','超级科技','https:////my.qidian.com/author/4166306, https:////www.qidian.com/2cy','晨星LL, 二次元','连载中','https:////bookcover.yuewen.com/qdbimg/349573/1011449273/150','\r                        “系统，积分能兑钱吗？”“不能。”“干，那我要你何用！”“本系统能让你当上学爸，全人类爸爸的爸，你还要钱有什么用？”本书又名《我要当学霸》\r                    ','学霸的黑科技系统');
insert  into `起点列表`(`md5`,`数据id`,`分类1`,`小说主页`,`分类2`,`作者首页`,`作者`,`发布状态`,`书面`,`小说简介`,`书名`) values (NULL,'1011335417','悬疑灵异','https:////book.qidian.com/info/1011335417','恐怖惊悚','https:////my.qidian.com/author/3780268, https:////www.qidian.com/2cy','纯洁滴小龙, 二次元','连载中','https:////bookcover.yuewen.com/qdbimg/349573/1011335417/150','\r                        一家只在深夜开门营业的书屋，欢迎您的光临。————————《vip全订书友群》：557560752（进群粉丝值验证）《读书群》：523978007（无需验证）《战斗群》：457654443（无需验证）\r                    ','深夜书屋');
insert  into `起点列表`(`md5`,`数据id`,`分类1`,`小说主页`,`分类2`,`作者首页`,`作者`,`发布状态`,`书面`,`小说简介`,`书名`) values (NULL,'1009704712','玄幻','https:////book.qidian.com/info/1009704712','东方玄幻','https:////my.qidian.com/author/4362125','宅猪','连载中','https:////bookcover.yuewen.com/qdbimg/349573/1009704712/150','\r                        大墟的祖训说，天黑，别出门。大墟残老村的老弱病残们从江边捡到了一个婴儿，取名秦牧，含辛茹苦将他养大。这一天夜幕降临，黑暗笼罩大墟，秦牧走出了家门……做个春风中荡漾的反派吧！瞎子对他说。秦牧的反派之路，\r                    ','牧神记');
insert  into `起点列表`(`md5`,`数据id`,`分类1`,`小说主页`,`分类2`,`作者首页`,`作者`,`发布状态`,`书面`,`小说简介`,`书名`) values (NULL,'3602691','都市','https:////book.qidian.com/info/3602691','异术超能','https:////my.qidian.com/author/4362241, https:////www.qidian.com/2cy','圣骑士的传说, 二次元','连载中','https:////bookcover.yuewen.com/qdbimg/349573/3602691/150','\r                        某天，宋书航意外加入了一个仙侠中二病资深患者的交流群，里面的群友们都以‘道友’相称，群名片都是各种府主、洞主、真人、天师。连群主走失的宠物犬都称为大妖犬离家出走。整天聊的是炼丹、闯秘境、炼功经验啥的。\r                    ','修真聊天群');
insert  into `起点列表`(`md5`,`数据id`,`分类1`,`小说主页`,`分类2`,`作者首页`,`作者`,`发布状态`,`书面`,`小说简介`,`书名`) values (NULL,'1005236478','仙侠','https:////book.qidian.com/info/1005236478','幻想修仙','https:////my.qidian.com/author/4362895','跃千愁','连载中','https:////bookcover.yuewen.com/qdbimg/349573/1005236478/150','\r                        一个地球神级盗墓宗师，闯入修真界的故事……桃花源里，有歌声。山外青山，白骨山。五花马，千金裘，倚天剑。应我多情，啾啾鬼鸣，美人薄嗔。天地无垠，谁家旗鼓，碧落黄泉，万古高楼。为义气争雄！为乱世争霸！你好\r                    ','道君');
insert  into `起点列表`(`md5`,`数据id`,`分类1`,`小说主页`,`分类2`,`作者首页`,`作者`,`发布状态`,`书面`,`小说简介`,`书名`) values (NULL,'1012237441','都市','https:////book.qidian.com/info/1012237441','异术超能','https:////my.qidian.com/author/3228548, https:////www.qidian.com/2cy','老鹰吃小鸡, 二次元','连载中','https:////bookcover.yuewen.com/qdbimg/349573/1012237441/150','\r                        地窟入侵，武道崛起。小人物也有大情怀，为生存而战，为守护而战。且看小人物方平，一步步崛起，拯救（忽悠）全世界的故事！（一群群号555700424，二群群号931250725，全订验证群号6250120\r                    ','全球高武');
insert  into `起点列表`(`md5`,`数据id`,`分类1`,`小说主页`,`分类2`,`作者首页`,`作者`,`发布状态`,`书面`,`小说简介`,`书名`) values (NULL,'1010136878','历史','https:////book.qidian.com/info/1010136878','架空历史','https:////my.qidian.com/author/4362112','孑与2','连载中','https:////bookcover.yuewen.com/qdbimg/349573/1010136878/150','\r                        我们接受了祖先的遗产，这让中华辉煌了数千年，我们是如此的心安理得，从未想过要回归那个在刀耕火种中苦苦寻找出路的时代。反哺我们苦难的祖先，并从中找到故乡的真正意义，将是本书要讲的故事。\r                    ','汉乡');
insert  into `起点列表`(`md5`,`数据id`,`分类1`,`小说主页`,`分类2`,`作者首页`,`作者`,`发布状态`,`书面`,`小说简介`,`书名`) values (NULL,'1010399782','玄幻','https:////book.qidian.com/info/1010399782','东方玄幻','https:////my.qidian.com/author/32610','高楼大厦','连载中','https:////bookcover.yuewen.com/qdbimg/349573/1010399782/150','\r                        一树生的万朵花，天下道门是一家。法术千般变化，人心却亘古不变\r                    ','太初');
insert  into `起点列表`(`md5`,`数据id`,`分类1`,`小说主页`,`分类2`,`作者首页`,`作者`,`发布状态`,`书面`,`小说简介`,`书名`) values (NULL,'1010191960','都市','https:////book.qidian.com/info/1010191960','都市生活','https:////my.qidian.com/author/5175790, https:////www.qidian.com/2cy','会说话的肘子, 二次元','连载中','https:////bookcover.yuewen.com/qdbimg/349573/1010191960/150','\r                        高中生吕树在一场车祸中改变人生，当灵气复苏时代来袭，他要做这时代的领跑者。物竞天择，胜者为王。……全订验证群号：696087569\r                    ','大王饶命');
insert  into `起点列表`(`md5`,`数据id`,`分类1`,`小说主页`,`分类2`,`作者首页`,`作者`,`发布状态`,`书面`,`小说简介`,`书名`) values (NULL,'1004179514','玄幻','https:////book.qidian.com/info/1004179514','异世大陆','https:////my.qidian.com/author/4362968','横扫天涯','连载中','https:////bookcover.yuewen.com/qdbimg/349573/1004179514/150','\r                        【2017最火玄幻作品，海外点推双榜第一】张悬穿越异界，成了一名光荣的教师，脑海中多出了一个神秘的图书馆。只要他看过的东西，无论人还是物，都能自动形成书籍，记录下对方各种各样的缺点，于是，他牛大了！教\r                    ','天道图书馆');
insert  into `起点列表`(`md5`,`数据id`,`分类1`,`小说主页`,`分类2`,`作者首页`,`作者`,`发布状态`,`书面`,`小说简介`,`书名`) values (NULL,'1012982353','玄幻','https:////book.qidian.com/info/1012982353','东方玄幻','https:////my.qidian.com/author/2799281','沉默的糕点','连载中','https:////bookcover.yuewen.com/qdbimg/349573/1012982353/150','\r                        穿越异世成为财主家的小白脸赘婿，因太废物被赶出来。于是他发奋图强，找一个更有权有势绝美高贵的豪门千金做了上门女婿。练武是不可能练武的，这辈子都不可能练武，只能靠吃软饭才能维持生活！我要把老婆培养成天下\r                    ','史上最强赘婿');
insert  into `起点列表`(`md5`,`数据id`,`分类1`,`小说主页`,`分类2`,`作者首页`,`作者`,`发布状态`,`书面`,`小说简介`,`书名`) values (NULL,'1010327039','仙侠','https:////book.qidian.com/info/1010327039','修真文明','https:////my.qidian.com/author/4362120','耳根','连载中','https:////bookcover.yuewen.com/qdbimg/349573/1010327039/150','\r                        举头三尺无神明，掌心三寸是人间。这是耳根继《仙逆》《求魔》《我欲封天》《一念永恒》后，创作的第五部长篇小说《三寸人间》。\r                    ','三寸人间');
insert  into `起点列表`(`md5`,`数据id`,`分类1`,`小说主页`,`分类2`,`作者首页`,`作者`,`发布状态`,`书面`,`小说简介`,`书名`) values (NULL,'1010468795','仙侠','https:////book.qidian.com/info/1010468795','古典仙侠','https:////my.qidian.com/author/4362096','我吃西红柿','连载中','https:////bookcover.yuewen.com/qdbimg/349573/1010468795/150','\r                        番茄继《吞噬星空》《莽荒纪》《雪鹰领主》后的第九本小说。————在这个世界，有狐仙、河神、水怪、大妖，也有求长生的修行者。修行者们，开法眼，可看妖魔鬼怪。炼一口飞剑，可千里杀敌。千里眼、顺风耳，更可探\r                    ','飞剑问道');
insert  into `起点列表`(`md5`,`数据id`,`分类1`,`小说主页`,`分类2`,`作者首页`,`作者`,`发布状态`,`书面`,`小说简介`,`书名`) values (NULL,'1010400217','科幻','https:////book.qidian.com/info/1010400217','时空穿梭','https:////my.qidian.com/author/4362948, https:////www.qidian.com/2cy','远瞳, 二次元','连载中','https:////bookcover.yuewen.com/qdbimg/349573/1010400217/150','\r                        高文穿越了，但穿越的时候稍微出了点问题。在某个异界大陆上空飘了十几万年之后，他觉得自己可能需要一具身体才算是成为一个完整的穿越者，但他并没想到自己好不容易成功之后竟然还需要带着这具身体从棺材里爬出来，\r                    ','黎明之剑');
